import React, { useState } from 'react';
import axios from 'axios';

const LoginPage: React.FC = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      const response = await axios.get(`https://task-manager-backend2.azurewebsites.net/api/Users/GetUser/${email}`, {
        auth: {
          username: email,
          password: password,
        }
      });
      console.log(response.data);
      // Aquí deberías manejar la redirección al dashboard o mostrar un mensaje de éxito.
    } catch (error) {
      console.error(error);
      // Maneja el error, como mostrar un mensaje al usuario.
    }
  };

  return (
    <form onSubmit={handleLogin}>
      <label>
        Email:
        <input type="email" value={email} onChange={e => setEmail(e.target.value)} />
      </label>
      <br />
      <label>
        Password:
        <input type="password" value={password} onChange={e => setPassword(e.target.value)} />
      </label>
      <br />
      <button type="submit">Login</button>
    </form>
  );
};

export default LoginPage;
